public class AssetModelFactory(string resourceName = null, Action<Humidifier.IoTSiteWise.AssetModel> factoryAction = null) : ResourceFactory<Humidifier.IoTSiteWise.AssetModel>(resourceName)
{

    internal List<InnerAssetModelAssetModelCompositeModelFactory> AssetModelCompositeModelsFactories { get; set; } = [];

    internal List<InnerAssetModelAssetModelHierarchyFactory> AssetModelHierarchiesFactories { get; set; } = [];

    internal List<InnerAssetModelAssetModelPropertyFactory> AssetModelPropertiesFactories { get; set; } = [];

    protected override Humidifier.IoTSiteWise.AssetModel Create()
    {
        var assetModelResult = CreateAssetModel();
        factoryAction?.Invoke(assetModelResult);

        return assetModelResult;
    }

    private Humidifier.IoTSiteWise.AssetModel CreateAssetModel()
    {
        var assetModelResult = new Humidifier.IoTSiteWise.AssetModel
        {
            GivenName = InputResourceName,
        };

        return assetModelResult;
    }
    public override void CreateChildren(Humidifier.IoTSiteWise.AssetModel result)
    {
        base.CreateChildren(result);

        result.AssetModelCompositeModels = AssetModelCompositeModelsFactories.Any() ? AssetModelCompositeModelsFactories.Select(x => x.Build()).ToList() : null;
        result.AssetModelHierarchies = AssetModelHierarchiesFactories.Any() ? AssetModelHierarchiesFactories.Select(x => x.Build()).ToList() : null;
        result.AssetModelProperties = AssetModelPropertiesFactories.Any() ? AssetModelPropertiesFactories.Select(x => x.Build()).ToList() : null;
    }

} // End Of Class

